DROP TABLE IF EXISTS `m_procedure`;
CREATE TABLE `m_procedure` (
  `procedure_id` varchar(32) NOT NULL DEFAULT '',
  `procedure_name` varchar(255) NOT NULL DEFAULT '',
  `procedure_key` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `jns_pelayanan_id` tinyint(4) unsigned DEFAULT NULL,
  `jns_pelayanan_name` varchar(64) DEFAULT NULL,
  `for_pelayanan_id` tinyint(4) unsigned DEFAULT NULL,
  `for_pelayanan_name` varchar(64) DEFAULT NULL,
  `grp_id` varchar(10) DEFAULT NULL,
  `grp_ids` varchar(255) DEFAULT NULL,
  `poli_id` varchar(6) DEFAULT NULL,
  `poli_name` varchar(64) DEFAULT NULL,
  `doctor_id` varchar(32) DEFAULT NULL,
  `doctor_name` varchar(128) DEFAULT NULL,
  `tags` varchar(255) DEFAULT NULL,
  `penunjang_tags` varchar(255) DEFAULT NULL,
  `acl` varchar(255) DEFAULT NULL,
  `hospital_id` varchar(32) NOT NULL,
  `rate` decimal(19,4) DEFAULT '0.0000',
  `rate_a` decimal(19,2) DEFAULT '0.00',
  `rate_b` decimal(19,2) DEFAULT '0.00',
  `rate_c` decimal(19,2) DEFAULT '0.00',
  `rate_d` decimal(19,2) DEFAULT '0.00',
  `rate_e` decimal(19,2) DEFAULT '0.00',
  `rate_f` decimal(19,2) DEFAULT '0.00',
  `rate_g` decimal(19,2) DEFAULT '0.00',
  `rate_h` decimal(19,2) DEFAULT '0.00',
  `rate_i` decimal(19,2) DEFAULT '0.00',
  `rate_j` decimal(19,2) DEFAULT '0.00',
  `procedure_type` enum('tindakan','pemeriksaan','alat','administrasi','paket-layanan') DEFAULT 'pemeriksaan',
  `jns_tarif` varchar(32) DEFAULT NULL,
  `group_payment` varchar(32) DEFAULT NULL,
  `since` datetime DEFAULT NULL,
  `until` datetime DEFAULT NULL,
  `company_id` varchar(32) DEFAULT NULL,
  `company_name` varchar(128) DEFAULT NULL,
  `company_percentage_cover` decimal(6,2) DEFAULT '0.00',
  `company_fix_cover` decimal(19,2) DEFAULT '0.00',
  `publish_at` varchar(128) DEFAULT NULL,
  `publish_start` datetime DEFAULT NULL,
  `publish_end` datetime DEFAULT NULL,
  `meta_data` text,
  `table_ref` varchar(128) DEFAULT NULL COMMENT 'nama table db lama',
  `column_ref` varchar(128) DEFAULT NULL COMMENT 'nama kolom db lama',
  `ref_id` varchar(128) DEFAULT NULL COMMENT 'value id db lama',
  `sync_ref_id` varchar(128) DEFAULT NULL,
  `ref_code` varchar(256) DEFAULT NULL,
  `procedure_id_ris` int(4) DEFAULT NULL,
  `inhealth_id` varchar(16) DEFAULT NULL,
  `is_active` smallint(2) DEFAULT '1',
  `created_date` datetime DEFAULT NULL,
  `created_by` varchar(32) DEFAULT NULL,
  `created_by_name` varchar(128) DEFAULT NULL,
  `modified_date` datetime DEFAULT NULL,
  `modified_by` varchar(32) DEFAULT NULL,
  `modified_by_name` varchar(128) DEFAULT NULL,
  PRIMARY KEY (`procedure_id`,`hospital_id`) USING BTREE,
  FULLTEXT KEY `procedure_name` (`procedure_name`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

